import React from "react"

export default function Item(props){
    const styles = {
        fontFamily: "serif",
        color: "red"
    }
    return(
        <div>
            <input type="checkbox" id="thing" />
            <label for="thing" style = {styles}> {props.name}</label><br/>
        </div>
    )
}
